import Dropdown from 'react-dropdown';
import 'react-dropdown/style.css';
import "./componentsStyles.css"

const DropDownButton = ({ options, value, onChange}) => (

    <div class="row">
    <label >
      Country
    </label>
    <Dropdown  
    options={options}
    value={value} 
    icon={options.icon}
    className= "dropdownButton"
    onChange={onSelect}
    />
  </div>



);

export default DropDownButton;
